import React from 'react';
import {Link } from 'react-router-dom';
function Navbar(props) {
    
        return (
           
            <React.Fragment> 
            <div className="navbar navbar-expand-lg bg-dark d-flex">
                <a className="navbar-brand" href="/"> Title </a>  
                <div className="navbar-nav ml-auto mr-0">                    
                      
                <Link to="/about" className="navbar-link p-1 "> About </Link>
                 <Link to="/contacto" className="navbar-link p-1 "> Contacto </Link>  
                 <Link to="/trabajo" className="navbar-link p-1 "> Trabajo </Link> 
                    </div> 
                     
            </div> 
              {props.children}
            </React.Fragment> 
              

        )
    
}


export default Navbar;
